import React from 'react';
import classes from './Salad.module.css';

const Salad = (props) => {
    return (

        <img className={classes.plate} src='/Users/jungin/Desktop/salad-app/src/asset/images/plate.png' alt='saladPlate'/>
    );
}

export default Salad;
